import { createSlice } from "@reduxjs/toolkit";
import API from "src/axios/axios";

const initialState = {
  widget: {
    users: "13",
    posts: "120",
    orders: "120",
    product: "15",
  },
};

const dashboardSlice = createSlice({
  name: "dashboard",
  initialState,
  reducers: {
    getWidgetData(state, action) {},
  },
});

export default dashboardSlice;

export const getWidgetData = () =>{
    return dashboard => {
        API.get()
    }
}
